import { makeStyles } from "@material-ui/core";

export default makeStyles((theme) => ({
    chip: {
        margin: "5px 5px 5px 0",
    },

    sutitle: {
        display: "flex",
        alignItems: "center",
        justifyContent: "space-between",
        marginTop: "10px",
    },

    spacing: {
        display: "flex",
        alignItems: "center",
        justifyContent: "space-between",
    },

}))
